'use strict';(function(){const indexCfg={cache:true};indexCfg.doc={id:'id',field:['title','content'],store:['title','href'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/study-python/docs/appendix/tutorial/','title':"教程",'content':"教程 基础 进阶 高阶 "});index.add({'id':1,'href':'/study-python/docs/basic/','title':"第一部分 基础入门",'content':""});index.add({'id':2,'href':'/study-python/docs/basic/practice/spec/','title':"编程规范",'content':"编程规范 "});index.add({'id':3,'href':'/study-python/docs/basic/grammar/','title':"语法",'content':"语法 "});index.add({'id':4,'href':'/study-python/docs/basic/package/manage/','title':"包管理",'content':"Python 包管理 pip 加速 修改 ~/.pip/pip.conf\n[global] index-url = https://pypi.tuna.tsinghua.edu.cn/simple [install] trusted-host = pypi.tuna.tsinghua.edu.cn "});index.add({'id':5,'href':'/study-python/docs/appendix/interview/basic/','title':"基础",'content':"基础面试题 "});index.add({'id':6,'href':'/study-python/docs/basic/version/','title':"版本",'content':"Python 版本 "});index.add({'id':7,'href':'/study-python/docs/basic/version/manage/','title':"版本管理",'content':"Python 版本管理 pyenv pyenv 加速 在 .zshrc 添加\nfunction pyenvinstall { wget -c https://npm.taobao.org/mirrors/python/$@/Python-$@.tar.xz -P ~/.pyenv/cache/ pyenv install $@ } 执行 zsh 使配置生效， 之后即可这样安装： pyenvinstall 3.8.2\npyenv 基础命令 pyenv global 3.8.2 2.7.17 set by ~/.pyenv/version\n3.8.2 2.7.17 pyenv shell 3.8.2 2.7.17 set by PYENV_VERSION environment variable\n$ echo $PYENV_VERSION 3.8.2:2.7.17 "});index.add({'id':8,'href':'/study-python/docs/design/','title':"第二部分 设计",'content':""});index.add({'id':9,'href':'/study-python/docs/appendix/interview/advanced/','title':"进阶",'content':"进阶面试题 "});index.add({'id':10,'href':'/study-python/docs/appendix/interview/','title':"面试题",'content':"面试题 基础题 进阶题 高阶题 "});index.add({'id':11,'href':'/study-python/docs/source/','title':"第三部分 源码实现",'content':""});index.add({'id':12,'href':'/study-python/docs/appendix/interview/expert/','title':"高阶",'content':"高阶面试题 "});index.add({'id':13,'href':'/study-python/docs/appendix/','title':"第四部分 附录",'content':""});index.add({'id':14,'href':'/study-python/docs/basic/package/','title':"包",'content':""});index.add({'id':15,'href':'/study-python/docs/basic/practice/','title':"最佳实践",'content':"最佳实践 "});index.add({'id':16,'href':'/study-python/docs/basic/practice/spec/baidu/','title':"百度 Python 编码规范",'content':"百度 Python 编码规范 "});index.add({'id':17,'href':'/study-python/docs/basic/grammar/slice/','title':"切片",'content':"切片 语法 [start:end:step] step 为负数 最后一个字符到下标是 -1，即从右到左，是从 -1 开始，然后 -1、-2、-3、-4、-5\n字符串反转 $ letter[::-1] "});index.add({'id':18,'href':'/study-python/docs/basic/grammar/class/','title':"类",'content':"类 问答 class 后面加不加 object 的区别 python 3 中已经默认就帮你加载了 object 了（即便你没有写上 object）\n   python 2.x python 2.x python 3.x python 3.x     不含 object 含 object 不含 object 含 object   __doc__ __doc__ __doc__ __doc__   __module__ __module__ __module__ __module__    __class__ __class__ __class__    __delattr__ __delattr__ __delattr__    __dict__ __dict__ __dict__    __format__ __format__ __format__    __getattribute__ __getattribute__ __getattribute__    __hash__ __hash__ __hash__    __init__ __init__ __init__    __new__ __new__ __new__    __reduce__ __reduce__ __reduce__    __reduce_ex__ __reduce_ex__ __reduce_ex__    __repr__ __repr__ __repr__    __setattr__ __setattr__ __setattr__    __sizeof__ __sizeof__ __sizeof__    __str__ __str__ __str__    __subclasshook__ __subclasshook__ __subclasshook__    __weakref__ __weakref__ __weakref__     __dir__ __dir__     __eq__ __eq__     __ge__ __ge__     __gt__ __gt__     __le__ __le__     __lt__ __lt__     __ne__ __ne__     __init_subclass__ __init_subclass__    init_subclass 类方法 __init_subclass__ 从 3.6 （whatsnew3.6） 引入，作用是可以在不使用元类的情况下改变子类的行为。严格来说它不属于元类编程，但也能达到编辑其他类的一种手段。\n参考：\n 理解 Python 中的 init_subclass  "});index.add({'id':19,'href':'/study-python/docs/appendix/snippet/','title':"代码片段",'content':"代码片段 "});index.add({'id':20,'href':'/study-python/docs/basic/version/3.7/','title':"3.7",'content':"Python 3.7 安装 依赖 sudo yum install readline readline-devel readline-static -y sudo yum install openssl openssl-devel openssl-static -y sudo yum install sqlite-devel -y sudo yum install bzip2-devel bzip2-libs -y libffi-devel 3.7 版本需要一个新的包 libffi-devel，安装此包之后再次进行编译安装即可。\nsudo yum install libffi-devel -y make install 若在安装前移除了 /usr/bin 下 python 的文件链接依赖，此时 yum 无法正常使用，需要自己下载相关软件包安装，为节省读者时间，放上链接\nwget http://mirror.centos.org/centos/7/os/x86_64/Packages/libffi-devel-3.0.13-18.el7.x86_64.rpm rpm -ivh libffi-devel-3.0.13-18.el7.x86_64.rpm 安装完成后重新进行 make install，结束后再次配置相关文件的软连接即可。\n解读： python3 中有个内置模块叫 ctypes，它是 python3 的外部函数库模块，提供了兼容 C 语言的数据类型，并通过它调用 Linux 系统下的共享库 (Shared library)，此模块需要使用 centos7 系统中外部函数库 (Foreign function library) 的开发链接库 (头文件和链接库)。 由于在 centos7 系统中没有安装外部函数库 (libffi) 的开发链接库软件包，所以在安装 pip 的时候就报了 \u0026ldquo;ModuleNotFoundError: No module named \u0026lsquo;_ctypes\u0026rsquo;\u0026rdquo; 的错误。\n"});index.add({'id':21,'href':'/study-python/categories/','title':"Categories",'content':""});index.add({'id':22,'href':'/study-python/docs/','title':"Docs",'content':""});index.add({'id':23,'href':'/study-python/tags/','title':"Tags",'content':""});index.add({'id':24,'href':'/study-python/','title':"首页",'content':""});})();